export const TimeList = ({TimeDates, GetPositions}) => {
  const [selectedTime, setSelectedTime] = useState(TimeDates[0].datetime);

  const SelectRadio = (arg) => {
    setSelectedTime(arg.value);
    GetPositions(arg.value);
  }

  return (
    <div id="TimeList">
      {
        TimeDates.length > 0
          ? (
            TimeDates.map((time, index) => (
              <label key={index}>
                <input
                  type="radio" name='time' value={time.datetime} checked={index===0} onChange={SelectRadio}/>{time.datetime}から<br/></label>)))
          : <p>データがありません</p>
      }
    </div>
  )
}
